  return (
    <div className="popup">
      <div className="popup-content">
        <span className="close" onClick={onClose}>
          &times;
        </span>
        <h1>Create Post</h1>
        {/* Your form elements here */}
      </div>
    </div>
  );
};

export default CreatePostForm;
